import { Box, Typography } from "@mui/material";
import React from "react";
import theme from "../utils/theme";
const CustomBake = ()=>{
  return <Box maxWidth={'lg'}>
    customBake page placeholder
    <Typography variant="h3" alignItems="center" sx={{ color: `${theme.color.primary}` }} gutterBottom>
      Custom Bake
    </Typography>
  </Box>
}

export default CustomBake;
